    <div class="map-instructions"><p>To explore our map, click on the sidebar titles or double click on an area.</p></div>
    <h1>We've Expanded!</h1>
    <h2>Tour our new facility...</h2>
</div>

<div id="content">

    <div id="content-welcome" class="ow">
        <h2>Welcome</h2>
        <p>We are KMM Group, Ltd., a collaborative fusion of three world-class companies: the KVI Group, M&S Centerless Grinding, Inc., and Meron Medical. We manufacture mission-critical components with exacting precision for medtech, aerospace, defense, high tech, and space exploration industries.</p>
        <p>We're thrilled to announce the completion of our brand-new facility in Hatboro, PA!</p>
        <ul>
            <li>~100,000 SQ FT of Workspace</li>
            <li>150+ Milling, Turning, Grinding and EDM Machines</li>
            <li>ISO Class 8 Clean Room</li>
            <li>150+ craftspeople, engineers, and manufacturing professionals</li>
        </ul>
        <p>With a combined 100-year history of experience, we solve thorny manufacturing challenges to make the impossible possible.</p>
        <p>How can we help you?</p>
        <button class="goto" data-section="rand">Research & Development</button>
    </div>

    <div id="content-rand" class="ow">
        <h2>Research & Development</h2>
        <p>Our dedicated research & development resources support all your engineering needs, from feasibility and rapid prototyping to validation and full production. Access our state-of-the-art equipment and a talented team committed to solving your manufacturability concerns to expedite your timeline and save costs.</p>
        <p>We complement your mission-critical R&D efforts with:</p>
        <ul>
            <li>5-Axis Milling</li>
            <li>10-Axis Swiss</li>
            <li>Surface Grinding</li>
            <li>Hybrid Centerless</li>
            <li>Guidewire Grinding</li>
            <li>EDM</li>
            <li>ISO Class 8 Clean Room</li>
        </ul>
        <p>We've met the rigorous R&D demands across every high-tech industry for decades and are ready to do the same for you.</p>
        <p>Learn more about our <a href='https://kmmgrp.com/services/dedicated-rd-resources/' target='_blank'>dedicated R&D capabilities</a> designed to bring your high-tech innovation to life.</p>
        <button class="goto" data-section="guidewire">Guidewire Grinding</button>
    </div>

    <div id="content-guidewire" class="ow">
        <h2>Guidewire Grinding</h2>

        <p>Using innovative grinding techniques, we solve many capability and cost-related challenges with guidewires. We thrive on pioneering methods to satisfy extremely small diameters (<.002") and intricate configurations. Through advanced technologies and seasoned expertise, our guidewire grinding services produce wires and stylets for devices used in aneurysm
            coiling, clot extraction, CRM, interventional cardiology, angioplasty, neuromodulation, thrombus busting, and more.</p>
        <ul>
            <li>Diameter tolerances to +/-.0001"</li>
            <li>Ground length tolerances to +/-.005"</li>
            <li>Wire lengths to 15 ft+</li>
            <li>Steps, tapers, ball ends, back tapers, tight corner radii, paddles, flats, etc.</li>
            <li>Long grind lengths up to 48" (1200mm) in ongoing production</li>
            <li>Range of materials, including SST, NiTi, MP35N, and Precious Metals, and additional exotic alloys like Inconel, Hastelloy, etc.</li>
        </ul>
        <p>Learn more about our <a href='https://kmmgrp.com/services/centerless-grinding/#Guidewire' target='_blank'>guidewire grinding capabilities</a> and how we can help you succeed.</p>
        <button class="goto" data-section="hybridgrinding">Hybrid Grinding</button>
    </div>

    <div id="content-hybridgrinding" class="ow">
        <h2>Hybrid Grinding</h2>

        <p>Our <a href='https://kmmgrp.com/services/centerless-grinding/#Hybridcnc' target='_blank'>hybrid CNC centerless grinding capabilities</a> provide exceptional solutions for problem parts that our competitors have declined. Anything but traditional, our expert hybrid CNC centerless grinding processes allow us to work with materials and part configurations not easily managed by conventional methods, illuminating the way for extremely intricate forms and micro-sized parts.</p>
        <ul>
            <li>CNC OD and CNC ID Grinding</li>
            <li>Super-thin (.001") wall thickness on OD/ID grinds without crushing the parts  Diameter tolerances to +/-.00005" (1.2 microns)</li>
            <li>Diameter range: OD - .003" to 2.50", ID - .060" to 2"</li>
            <li>Micro parts (ODs)</li>
            <li>Finishes to 2 Ra (.05 micron)</li>
            <li>All materials including glass, M2, Tungsten, Titanium, Nitinol, etc.</li>
        </ul>
        <p>When there is no margin for error, choose us to get it right.</p>
        <button class="goto" data-section="infeed">Infeed Centerless Grinding</button>
    </div>

    <div id="content-infeed" class="ow">
        <h2>Infeed Centerless Grinding</h2>
        <p>Our precision centerless grinding capabilities combine exceptional talent with state-of-the-art technology and innovative processes to elevate the traditional industry standards.</p>
        <ul>
            <li>Diameters from .014" (.355mm) to 14" (355.6mm)</li>
            <li>Lengths to 14 ft (4.267m) **(14 ft length limited to bars <=.75" (19mm) diameter)</li>
            <li>Standard tolerances to +/-.0001" (2.5 microns)</li>
            <li>Ultra-precision tolerances to +/-.00002 (.5 micron)</li>
            <li>Precision bars ground for Swiss-screw machines with tolerances to +/-.0001"</li>
            <li>Finishes to < 2 Ra (.05 micron)</li>
            <li>All materials, including glass, M2, Tungsten, Titanium, and Nitinol, etc.</li>
        </ul>
        <p>Learn more about our <a href='https://kmmgrp.com/services/centerless-grinding/#Centerless' target='_blank'>precision centerless grinding capabilities</a> for your mission-critical component manufacturing needs.</p>
        <button class="goto" data-section="bargrinding">Bar Grinding</button>
    </div>

    <div id="content-bargrinding" class="ow">
        <h2>Bar Grinding</h2>
        <p>We provide high-quality thru-feed and in-feed centerless grinding for bar materials and round components to exceptionally close tolerances.</p>
        <ul>
            <li>Diameters from .014" (0.355mm) to 14" (355.6mm)</li>
            <li>Lengths to 14 ft (4.267m) **(14 ft length limited to bars <=.75" (19mm) diameter)</li>
            <li>Standard tolerances to +/-.0001" (2.5 microns)</li>
            <li>Ultra-precision tolerances to +/-.00002" (.5 micron)</li>
            <li>Precision bars ground for Swiss-screw machines with tolerances to +/-.0001"</li>
            <li>Finishes to < 2 Ra (.05 micron)</li>
            <li>All materials, including glass, M2, Tungsten, Titanium, and Nitinol, etc.</li>
        </ul>
        <p>KMM Group's centerless grinding capabilities are the perfect solution for finishing your spools, medical instruments and other critical components.</p>
        <button class="goto" data-section="cncodid">Multi-Axis CNC OD/ID Grinding</button>
    </div>

    <div id="content-cncodid" class="ow">
        <h2>Multi-Axis CNC OD/ID Grinding</h2>
        <p>Tackling the most demanding sub-micron tolerances for concentricity and runout can be achieved through our ability to grind multiple part features (OD's, ID's and faces) in one chucking. Diameters can be controlled to the same tolerances with in-process gauging, and Non-Round shapes/ features can be ground to highly precise geometries and tolerances.</p>
        <ul>
            <li>Multiple part features in one chucking</li>
            <li>Eccentric and Non-Round grinding - shapes and non-round features generated by interpolation of the grinding wheel</li>
            <li>Diameter range: OD to 14", ID to 7"</li>
            <li>Length range: OD to 40" Long, ID to 7" Deep</li>
            <li>Diameter tolerances to +/-.00005" (1.2 micron)</li>
            <li>Finishes to 2 Ra (.05 micron)</li>
            <li>Wide range of materials</li>
        </ul>
        <p>Learn more about our <a href='https://kmmgrp.com/services/centerless-grinding/#Multiaxiscnc' target='_blank'>multi-axis CNC OD/ID grinding</a> capabilities.</p>
        <button class="goto" data-section="cncthrufeed">ThruFeed Centerless Grinding</button>
    </div>

    <div id="content-cncthrufeed" class="ow">
        <h2>ThruFeed Centerless Grinding</h2>
        <p>With unparalleled expertise in precision <a href='https://kmmgrp.com/services/centerless-grinding/#Centerless' target='_blank'>thrufeed centerless grinding</a>, we produce consistent dimensional tolerances and straightness designed to surpass your expectations.</p>
        <ul>
            <li>Diameters from .014" (0.355mm) to 14" (355.6mm)</li>
            <li>Lengths to 14 ft (4.267m) **(14 ft length limited to bars <=.75" (19mm) diameter)</li>
            <li>Standard tolerances to +/-.0001" (2.5 microns)</li>
            <li>Ultra-precision tolerances to +/-.00002" (.5 micron)</li>
            <li>Precision bars ground for Swiss-screw machines with tolerances to +/-.0001"</li>
            <li>Finishes to < 2 Ra (.05 micron)</li>
            <li>All materials, including glass, M2, Tungsten, Titanium, and Nitinol, etc.</li>
        </ul>
        <p>Put our exceptional thrufeed expertise to work for you!</p>
        <p>Learn more about our <a href='https://kmmgrp.com/services/centerless-grinding/#Centerless' target='_blank'>centerless grinding capabilities</a> and discover how we can solve your toughest manufacturing challenges.</p>
        <button class="goto" data-section="edm">EDM</button>
    </div>

    <div id="content-edm" class="ow">
        <h2>Electrical Discharge Machining</h2>
        <p>We offer wire and ram electrical discharge machining (EDM) capabilities to expertly machine high-quality complex parts for repeatability and cost-effectiveness.</p>
        <p>Our wire EDM capabilities include:</p>
        <ul>
            <li>Envelope up to 41.3" x 31.5" x 11.86"</li>
            <li>Ultra-precision wire EDM tolerances <.0001"</li>
            <li>Finishes to 4 RMS</li>
            <li>B Axis (Rotary) for 6-axis 'turn and burn'</li>
        </ul>
        <p>What EDM challenge can we solve for you? Learn more about our <a href='https://kmmgrp.com/services/precision-machining/' target='_blank'>wire EDM and ram EDM services</a>. Let's make the impossible possible!</p>
        <button class="goto" data-section="cncswiss">CNC Swiss</button>
    </div>

    <div id="content-cncswiss" class="ow">
        <h2>Swiss Screw Machining</h2>
        <p>Our 13-axis Swiss screw machining capabilities can produce high-precision components with tolerances as low as 5 microns. Ideal for close tolerances and complex parts, our Swiss department delivers exacting precision on low to high volume runs of 50 to 500,000 parts.</p>
        <ul>
            <li>Up to 32mm through the spindle</li>
            <li>Up to 13 axes</li>
            <li>Tolerances to .0002" (5 microns)</li>
            <li>Specialists in working with medical and aircraft alloys  Low volume to high-production (50 to 500,000 pieces)</li>
        </ul>
        <p>Learn more about our <a href='https://kmmgrp.com/services/precision-machining/#SwissScrew' target='_blank'>Swiss screw machining services</a> for your ultra-precision machining project.</p>
        <button class="goto" data-section="hmc">Horizontal Machining Centers</button>
    </div>

    <div id="content-hmc" class="ow">
        <h2>Horizontal Machining Centers</h2>
        <p>Our state-of-the-art horizontal machining centers (HMCs) provide the highest stability, precision, and dynamics to help us produce your ultra-precision parts reliably and cost-effectively. These powerful machines feature the latest automation, control, and software for superior results, giving our veteran craftspeople tools to solve complex manufacturing challenges.</p>
        <ul>
            <li>Advanced high-productivity systems</li>
            <li>Ultra-precise resolution to 0.00025 in</li>
            <li>Integrated digitization capabilities to maximize cost-efficiency</li>
        </ul>
        <p><a href='https://kmmgrp.com/contact' target='_blank'>Contact us</a> to learn more about our HMC department and how our team can put these innovative technologies to the test for you.</p>
        <button class="goto" data-section="vmc">Vertical Machining Centers</button>
    </div>

    <div id="content-vmc" class="ow">
        <h2>Vertical Machining Centers</h2>
        <p>Our CNC milling capabilities combine state-of-the-art equipment and talented machine technicians to produce complex parts within near-perfect tolerances. Our in-depth experience and perseverance to meet the most demanding requirements make us the leading supplier to global tier-one companies.</p>
        <ul>
            <li>3.15'' bar through spindle and 17" between centers</li>
            <li>11-axis capability</li>
            <li>.0002" tolerances</li>
            <li>8 Ra finishes</li>
            <li>Experience with over 60 materials</li>
        </ul>
        <p>When precision and experience matter, trust our CNC milling capabilities to produce accurate and timely components to propel your project forward.</p>
        <p>Learn more about our <a href='https://kmmgrp.com/services#milling' target='_blank'>CNC milling services</a> for your ultra-precision machining project.</p>
        <button class="goto" data-section="millturn">Mill Turn</button>
    </div>

    <div id="content-millturn" class="ow">
        <h2>Mill Turn</h2>
        <p>Our milling/turning capabilities combine state-of-the-art equipment and talented machine technicians to produce complex parts within near-perfect tolerances, giving us an edge in high-precision industries. Our deep dedication to excellence and vast experience with an extraordinary number of material types make us the leading supplier to tier-one aerospace companies around the globe.</p>
        <ul>
            <li>3.15'' bar through spindle and 17" between centers</li>
            <li>11-axis capability</li>
            <li>.0002" tolerances</li>
            <li>8 Ra finishes</li>
            <li>Experience with over 60 materials</li>
        </ul>
        <p>With the latest equipment and craftspeople averaging 30 years of experience, we're your source for ultra-precision CNC turning solutions to your thorny manufacturing challenge.</p>
        <p>Learn more about our <a href='https://kmmgrp.com/services/precision-machining/#CNC' target='_blank'>mill turning services</a> to discover why we're a top choice for tier-one companies worldwide.</p>
        <button class="goto" data-section="lasers">Laser Processes</button>
    </div>

    <div id="content-lasers" class="ow">
        <h2>Laser Processes</h2>

        <p>Femtosecond laser micromachining is an ultra-precise cold ablation cutting process that has little to no thermal impact on the heat affected zone (HAZ) of the parts being produced.</p>
        <p>Femtosecond (1 fs = 1015 s) laser light pulses can cut complex shapes with surgical precision and extreme dimensional accuracy.</p>

        <ul>
            <li>Tolerances to +/- .0005" (13 microns)</li>
            <li>Virtually any material can be marked or cut: metals, polymers, glass, ceramics and more</li>
            <li>Surfaces can be enhanced with lattice structures or micro-textured patterns</li>
            <li>No thermal impact and no change to the material's original characteristics</li>
            <li>No structural changes to the original material</li>
            <li>No micro cracks, no debris, no recast layer</li>
        </ul>

        <p>We're building out our laser cutting and marking capabilities to further strengthen our ultra-precision machining and centerless grinding services.</p>

        <button class="goto" data-section="qualitymedclean">Quality Medical</button>
    </div>

    <div id="content-qualitymedclean" class="ow">
        <h2>Quality Medical & Clean Room</h2>
        <p>Located in our facility's Quality Control (QC) area, our ISO 14644 cleanroom sits adjacent to a large wash tank for wires and tubes, functioning as the final stage of cleaning and packaging.</p>
        <ul>
            <li>99.99% HEPA fan filters keep the airborne particles at bay</li>
            <li>Sealed LED paneled light fixtures protect against particle formation</li>
            <li>Easily cleanable vinyl curtains and vinyl-coated sheetrock for the ultimate cleanliness</li>
            <li>Specialized cleanroom-friendly ceiling tiles</li>
